import DeleteIcon from '@mui/icons-material/Delete';



const TodoList = ({todos}) => {
  const [clicked, setClicked] = useState(false)

  const handleClick = (e) => {
    setClicked(curr=> !curr)
  }
  return (
    <div>
      {todos.map((item, i) =>
      <div key={i}>
        <span></span>
        <p>{item.todo}</p>
        <span></span>
        </div>
        )}
    </div>
  )
}
